চালাতে হবে।</span></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n\r\n\r\n\r\n\r\n<br><p></p><div class=\"elementor-element elementor-element-33fe2c9f elementor-widget elementor-widget-text-editor\" data-id=\"33fe2c9f\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<p><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\"><img src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/t44/1.5/16/26d4.png\" alt=\"⛔\" width=\"16\" height=\"16\"></span>&nbsp;উক্ত শর্তটি পুরন করতে না পারলে কখনোই সুপার এজেন্টদের নক দিবেন না।</p><p><br></p></div></div><h2 class=\"elementor-heading-title elementor-size-default\">এজেন্ট পয়েন্ট রেটঃ-</h2><p><br></p><p>এজেন্টরা সুপার এজেন্টদের কাছ থেকে&nbsp;৭০ &nbsp;টাকা করে কয়েন&nbsp;কিনতে<span style=\"color: rgb(0, 0, 0); font-size: 0.875rem;\">&nbsp;পারবে এবং ১০০ টাকা করে ইজারদের কাছে বিক্রি করবে।</span></p><div class=\"elementor-element elementor-element-33fe2c9f elementor-widget elementor-widget-text-editor\" data-id=\"33fe2c9f\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\"><div class=\"elementor-widget-container\"><p><br></p></div></div><h2 class=\"elementor-heading-title elementor-size-default\">এজেন্ট এর লাভ/লস:-</h2><p><br></p><p>এজেন্টরা কয়েন প্রতি ৩০% লাভ পাবে। লাভ এবং লস বিস্তারিত জানতে সুপার এজেন্টদের নক করুন&nbsp; ।</p><p><br></p><h2>কিভাবে কয়েন কিনবো?</h2><p><br></p><p>এজেন্টের কাছ থেকে আপনাকে কয়েন কিনতে হবে। কিন্তু কয়েন কিনার আগে অবশ্যই \r\nআপনার পছন্দের এজেন্টের কাছ থেকে একাউন্ট করিয়ে নিবেন। কয়েন বেচা এবং কেনার\r\n কাজ এজেন্টই করে দিবে। এজেন্ট আপনাকে একাউন্ট খোলার নিয়ম বলে দিবে। এজেন্ট আপনাকে একাউন্ট খুলে দিবে। আমাদের সাইটে সর্বনিম্ন ডিপোজিট \r\nএবং উইথড্র&nbsp;৫০০ টাকা – মানে ৫০০পয়েন্ট।<br></p><p><br></p><div class=\"elementor-element elementor-element-33fe2c9f elementor-widget elementor-widget-text-editor\" data-id=\"33fe2c9f\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\"><div class=\"elementor-widget-container\"><p><br></p>\r\n</div>\r\n</div><p><br></p><p><br></p><div dir=\"ltr\"><strong><br></strong><br></div>', NULL, NULL, '2023-10-22', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 164, 1, 0, 7, NULL, NULL, 'একাউন্ট কিভাবে খুলবো?', 'Agentlist24-এ একাউন্ট আপনি নিজে নিজে ওপেন করতে পারবেন না। \r\nএকাউন্ট ওপেন করতে হলে আপনাকে এজেন্ট এর সাথে যোগাযোগ করতে হবে। এখানে \r\nএজেন্ট ই সব, এজেন্ট আপনাকে একাউন্ট ', NULL, 'ekaunt-kivabe-khulbo-1', 1, 1, '2023-10-22 10:24:31', '2024-06-20 15:34:12'),
(23, 'ইউজারদের সাধারন প্রশ্ন ও উত্তর', '<div dir=\"ltr\"><br></div><h2>লেনদেন কিভাবে করবো?</h2><p><br></p><p>➡️আপনি আপনার সকল লেনদেন আপনার এজেন্টের সাথে করবেন। এজেন্ট ব্যাতিত \r\nঅন্য কারো সাথে ভুলেও লেনদেন করবেন না। আপনি বিকাশ/নগদ/রকেটে লেনদেন করতে \r\nপারেন। সেক্ষেত্রে এজেন্টের সাথে পরামর্শ করে নিবেন।লেনদেনর ব্যাপারে নিচের\r\n নির্দেশনা গুলো পড়ে নিন-</p><p>➡️বিকাশ/নগদ/রকেটঃ ** অনেকেই আছেন – নিজের বিকাশ এজেন্ট নাই বা নিজের \r\nবিকাশ এজেন্ট এ লেনদেন করতে রিস্ক মনে করেন। সেই ক্ষেত্রে কোম্পানীর বিকাশ \r\nএজেন্ট ব্যবহার করতে পারেন। যদি কোম্পানীর বিকাশ – নগদ এজেন্ট ব্যবহার করেন\r\n তাহলে কয়েনের দাম একটু বেশি হবে ।</p><p><br></p><h2>বিকাশ/নগদে কি লেনদেন হয়?</h2><p><br></p><p>➡️জ্বী সাধারণত সকল লেনদেন ই বিকাশ/নগদ/রেকট/উপায় সহ ব্যাংকে লেনদেন হয়।\r\n আপনি এজেন্টদের সাথে যোগাযোগ করে লেনদেন করুন। আপনি যদি কার্ডে কয়েন কিনতে\r\n চান তাহলেও সম্ভব। আপনি এজেন্টদের সাথে যোগাযোগ করে কার্ড থেকেও লেনদেন \r\nকরতে পারেন।</p><p>➡️বিকাশ/নগদ/রকেটঃ ** অনেকেই আছেন – নিজের বিকাশ এজেন্ট নাই বা নিজের \r\nবিকাশ এজেন্ট এ লেনদেন করতে রিস্ক মনে করেন। সেই ক্ষেত্রে কোম্পানীর বিকাশ \r\nএজেন্ট ব্যবহার করতে পারেন। যদি কোম্পানীর বিকাশ – নগদ এজেন্ট ব্যবহার করেন\r\n তাহলে কয়েনের দাম একটু বেশি হবে ।</p><p><br></p><h2>আমি কি কয়েন জিতলেই টাকা পাবো?</h2><p><br></p><p>➡️জ্বী আপনি কয়েন জিতলেই উইড্র করে এজেন্টদের কাছ থেকে টাকা নিয়ে নিতে \r\nপারেন। তবে আপনার সর্বনিম্ন উইড্র হচ্ছে&nbsp;<span style=\"color: rgb(0, 0, 0); font-size: 0.875rem;\">&nbsp;</span><span style=\"color: rgb(0, 0, 0); font-size: 0.875rem;\">১০০</span><span style=\"color: rgb(0, 0, 0); font-size: 0.875rem;\">&nbsp;কয়েন বা ১০০ টাকা।বিস্তারিত \r\nজানতে এজেন্টের সাথে কথা বলুন।নিচে এজেন্ট লিস্ট দেয়া আছে। এজেন্ট লিস্টে \r\nগিয়ে তাদের নামের উপর ক্লিক করলেই সরাসরি তাদের সাথে ফেইসবুকে কথা বলতে \r\nপারবেন অথবা নাম্বারের উপর ক্লিক করলেই সরাসরি হোয়াটসঅ্যাপে যোগাযোগ করতে \r\nপারেন।</span></p><p><br></p><p><br></p><p><br></p><p><br></p><div dir=\"ltr\"><br></div>', NULL, NULL, '2023-10-22', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 170, 1, 0, 8, NULL, NULL, 'ইউজারদের সাধারন প্রশ্ন ও উত্তর', 'লেনদেন কিভাবে করবো?➡️আপনি আপনার সকল লেনদেন আপনার এজেন্টের সাথে করবেন। এজেন্ট ব্যাতিত \r\nঅন্য কারো সাথে ভুলেও লেনদেন করবেন না। আপনি বিকাশ/নগদ/রকেটে লেনদেন করতে \r\nপারেন', NULL, 'iujarder-sadharn-prsn-oo-uttr', 1, 1, '2023-10-22 11:16:22', '2024-06-21 01:50:16'),
(24, 'ইউজারদের সাধারন প্রশ্ন ও উত্তর', '<div dir=\"ltr\"><h2>ফেসবুক গ্রুপে কিভাবে যুক্ত হবো?</h2><p><br></p></div><p>আপনি নিচের লিংকে ক্লিক করলেই আপনি সরাসরি ফেইসবুক গ্রুপে চলে যাবেন। ফেইসবুকে ঢুকে গেলে তারপর <strong>Join</strong> -এ ক্লিক করে যুক্ত হয়ে যান।</p><p>➡️ <strong>ফেসবুক গ্রুপ II </strong><a rel=\"nofollow\" href=\"https://www.facebook.com/groups/857215775727998/permalink/857215795727996/?mibextid=Nif5oz\" target=\"_blank\" data-saferedirecturl=\"https://www.google.com/url?q=https://www.facebook.com/groups/857215775727998/permalink/857215795727996/?mibextid%3DNif5oz&amp;source=gmail&amp;ust=1698059946247000&amp;usg=AOvVaw3IuXtXVGyFWVH2fGtP-eVB\" style=\"color: rgb(17, 85, 204); font-style: normal; font-variant-caps: normal; font-weight: 400; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); font-family: Roboto, Arial, sans-serif; font-size: 16px; font-variant-ligatures: none; letter-spacing: 0.1px;\">https://www.facebook.com/<wbr>groups/857215775727998/<wbr>permalink/857215795727996/?<wbr>mibextid=Nif5oz</a> <br></p><div dir=\"ltr\"><p>\r\n<br></p></div><p>ফেইসবুক গ্রুপে সকল এজেন্ট, সুপার এজেন্ট এবং এডমিনরা রয়েছে। আপনার যেকোনো সমস্যা বা প্রয়োজনে আপনি সবাইকে পাশে পাবেন।</p><p><br></p><h2>কিভাবে বাজি ধরবো?</h2><p><br></p><p>আপনি এজেন্টদের কাছ থেকে একাউন্ট খুলে কয়েন কিনে নিন। তারপর নিচের লিংকে\r\n ক্লিক করে বাজি ওয়েবসাইটে গিয়ে আপনার পছন্দ মতো বাজি ধরতে পারেন।</p><p>➡️ <strong>এখানে বাজি ধরুন</strong></p><p>আপনি যদি না জানেন কিভাবে বাজি ধরতে হয় তাহলে আপনি আপনার এজেন্টের সাথে \r\nযোগাযোগ করুন। তারা আপনাকে পরিষ্কার ভাবে বুঝিয়ে দিবেন। আপনার এজেন্টদের \r\nসাথে যোগাযোগ করতে নিচের লিস্টে ক্লিক করে তাদের নামের উপর ক্লিক করুন। নাম\r\n খুঁজে না পেলে লিস্টের উপরের সার্চবারে সার্চ করুন।</p><p><br></p><h2>এখানে কি বাজি ধরা যায়?</h2><p><br></p><p>আপনি এজেন্টদের সাথে সরাসরি কথা বলে বাজির বিস্তারিত জানতে পারবেব। \r\nআমাদের এজেন্টরা ট্রাস্টেড এবং আপনি নিরাপদে বেটিং করতে পারেন। তবে যেকোনো \r\nবাজি ধরার আগে জেনে নিন আপনার এজেন্টের নাম এজেন্ট লিস্টে রয়েছে কিনা। \r\nযেকোন অভিযোগের জন্য এডমিন /সুপার এজেন্টদের সাথে যোগাযোগ করুন।</p><p>এজেনেট সম্পর্কে কোন অভিযোগ থাকলে সরাসরি কাস্টমার সার্ভিসে যোগাযোগ করতে পারেন অবথা সুপার এজেন্ট/এডমিনকে জানাতে পারেন।</p><p>&nbsp;➡️এখানে কি কি বাজি ধরা যায়?</p><p>আপনি অনেক ধরনের বাজিই ধরতে পারেন।এখানে <strong>ক্লিক</strong> করে ওয়েবসাইট ঘুরে দেখে আসতে পারেন</p><p>➡️ যেকোনো ক্রিকেট ম্যাচে বাজি ধরতে পারেন। প্রতি ম্যাচে, ওভারে বা বলে বলেও বাজি ধরতে পারেন।</p><p>➡️ IPL, BPL, PSL, T10 সহ সকল লিগ ম্যাচেও একইভাবে বাজি ধরতে পারেন।</p><p>➡️ সকল ফুটবল ম্যাচে বাজি গালাতে পারেন।</p><p>➡️ ক্যাসিনো খেলতে পারেন।</p><p>➡️ তিনপাত্তি সহ তাসের বাজি গুলোতে বেটিং করতে পারেন।</p><p>এছাড়াও আরো অনেক মজার মজার বাজি রয়েছে, যেগুলোতে আপনি অনায়াসে বাজি ধরতে পারেন। আরো বিস্তারিত জানতে 24bet.vip<strong>&nbsp;</strong>-এর ওয়েবসাইটে ঘুরে আসুন নিচে ক্লিক করে।</p><p><br></p><p><br></p><p><br></p><p><br></p><div dir=\"ltr\"><p><br></p></div>', NULL, NULL, '2023-10-22', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 144, 1, 0, 9, NULL, NULL, 'ইউজারদের সাধারন প্রশ্ন ও উত্তর', 'ফেসবুক গ্রুপে কিভাবে যুক্ত হবো?আপনি নিচের লিংকে ক্লিক করলেই আপনি সরাসরি ফেইসবুক গ্রুপে চলে যাবেন। ফেইসবুকে ঢুকে গেলে তারপর Join -এ ক্লিক করে যুক্ত হয়ে যান।➡️ ফেসবুক ', NULL, 'iujarder-sadharn-prsn-oo-uttr-1', 1, 1, '2023-10-22 11:23:04', '2024-06-18 01:05:19'),
