(53, 28, 8, 'আপনি আপনার সকল লেনদেন আপনার এজেন্টের সাথে করবেন। এজেন্ট ব্যাতিত অন্য কারো সাথে ভুলেও লেনদেন করবেন না। আপনি বিকাশ/নগদ/রকেটে লেনদেন করতে পারেন। সেক্ষেত্রে এজেন্টের সাথে পরামর্শ করে নিবেন।লেনদেনর ব্যাপারে নিচের নির্দেশনা গুলো পড়ে নিন-\r\n\r\n➡️বিকাশ/নগদ/রকেটঃ ** অনেকেই আছেন – নিজের বিকাশ এজেন্ট নাই বা নিজের বিকাশ এজেন্ট এ লেনদেন করতে রিস্ক মনে করেন। সেই ক্ষেত্রে কোম্পানীর বিকাশ এজেন্ট ব্যবহার করতে পারেন। যদি কোম্পানীর বিকাশ – নগদ এজেন্ট ব্যবহার করেন তাহলে কয়েনের দাম একটু বেশি হবে ।', '2023-10-22 14:12:38', '2023-10-22 14:12:38'),
(54, 29, 8, '➡️জ্বী সাধারণত সকল লেনদেন ই বিকাশ/নগদ/রেকট/উপায় সহ ব্যাংকে লেনদেন হয়। আপনি এজেন্টদের সাথে যোগাযোগ করে লেনদেন করুন। আপনি যদি কার্ডে কয়েন কিনতে চান তাহলেও সম্ভব। আপনি এজেন্টদের সাথে যোগাযোগ করে কার্ড থেকেও লেনদেন করতে পারেন।\r\n\r\n➡️বিকাশ/নগদ/রকেটঃ ** অনেকেই আছেন – নিজের বিকাশ এজেন্ট নাই বা নিজের বিকাশ এজেন্ট এ লেনদেন করতে রিস্ক মনে করেন। সেই ক্ষেত্রে কোম্পানীর বিকাশ এজেন্ট ব্যবহার করতে পারেন। যদি কোম্পানীর বিকাশ – নগদ এজেন্ট ব্যবহার করেন তাহলে কয়েনের দাম একটু বেশি হবে ।', '2023-10-22 14:13:40', '2023-10-22 14:13:40'),
(56, 31, 8, 'আপনি যদি নতুন ইউজার হোন তাহলে আপনি নিচে ক্লিক করে agentlist24 এর ফেইসবুক গ্রুপে যুক্ত হয়ে যান । কারণ, এখানে সকল অনুমোদিত এজেন্টরা রয়েছেন।\r\nআপনি যদি পুরাতন ইউজার হোন এবং আপনার পরিচিত অনেক ইউজার থেকে থাকে তাহলো আপনি নিজে এজেন্ট হয়ে বেট ধরিয়ে দিতে পারেন। সেজন্য আপনাকে সুপার এজেন্টের সাথে যোগাযোগ করতে হবে। এজেন্ট হতে চাইলে নিচে ক্লিক করুন।', '2023-10-22 14:16:16', '2023-10-22 14:16:16'),
(57, 32, 8, 'আপনি এজেন্টদের সাথে যোগাযোগ করতে পারেন ফেসবুকে বা হোয়াটসঅ্যাপে। ফেসবুকে যোগাযোগ করতে হলে আপনি নিচের এজেন্ট লিস্টে ঢুকে এজেন্টদের নামের উপর ক্লিক করলেই সরাসরি এজেন্টদের সাথে ফেসবুকে যুক্ত হয়ে যাবেন।তারপর এজেন্টকে মেসেজ দিন। আর হোয়াটসঅ্যাপে কথা বলতে নিচের এজেন্ট লিস্টে ঢুকে নাম্বারের উপর ক্লিক করুন। তারপর এজেন্টকে মেসেজ দিন।\r\n\r\nএই এজেন্ট লিষ্টের বাইরে কারো সাথে লেনদেন করলে আপনাকে নিজ দ্বায়িত্বে লেনদেন করতে হবে। লিষ্ট এর বাইরে কোন এজেন্ট এর দায়ভার agentlist24 নিবে না এবং লিষ্ট এর এজেন্ট দের সব দায়ভার agentlist24 কোম্পানীর। এজেন্ট লিষ্ট এর এজেন্ট দের সাথে দুই ভাবে যোগাযোগ করতে পারেন। ফেইসবুক এবং হোয়াটসঅ্যাপ। আপনি নিচের ফেইসবুক গ্রুপে যুক্ত হয়ে ও সকল এজেন্টদের সাথে যোগাযোগ করতে পারেন।', '2023-10-22 14:17:38', '2023-10-22 14:17:38'),
(58, 33, 8, 'আপনি নিচের লিংকে ক্লিক করলেই আপনি সরাসরি ফেইসবুক গ্রুপে চলে যাবেন। ফেইসবুকে ঢুকে গেলে তারপর Join -এ ক্লিক করে যুক্ত হয়ে যান।\r\nhttps://www.facebook.com/groups/857215775727998/permalink/857215795727996/?mibextid=Nif5oz\r\n\r\n\r\nফেইসবুক গ্রুপে সকল এজেন্ট, সুপার এজেন্ট এবং এডমিনরা রয়েছে। আপনার যেকোনো সমস্যা বা প্রয়োজনে আপনি সবাইকে পাশে পাবেন।', '2023-10-22 14:19:01', '2023-10-22 14:19:01'),
(59, 34, 8, 'আপনি এজেন্টদের কাছ থেকে একাউন্ট খুলে কয়েন কিনে নিন। তারপর নিচের লিংকে ক্লিক করে বাজি ওয়েবসাইটে গিয়ে আপনার পছন্দ মতো বাজি ধরতে পারেন।\r\n➡️ এখানে বাজি ধরুন\r\n\r\nআপনি যদি না জানেন কিভাবে বাজি ধরতে হয় তাহলে আপনি আপনার এজেন্টের সাথে যোগাযোগ করুন। তারা আপনাকে পরিষ্কার ভাবে বুঝিয়ে দিবেন। আপনার এজেন্টদের সাথে যোগাযোগ করতে নিচের লিস্টে ক্লিক করে তাদের নামের উপর ক্লিক করুন। নাম খুঁজে না পেলে লিস্টের উপরের সার্চবারে সার্চ করুন।', '2023-10-22 14:19:59', '2023-10-22 14:19:59'),
(60, 35, 8, 'আপনি এজেন্টদের সাথে সরাসরি কথা বলে বাজির বিস্তারিত জানতে পারবেব। আমাদের এজেন্টরা ট্রাস্টেড এবং আপনি নিরাপদে বেটিং করতে পারেন। তবে যেকোনো বাজি ধরার আগে জেনে নিন আপনার এজেন্টের নাম এজেন্ট লিস্টে রয়েছে কিনা। যেকোন অভিযোগের জন্য এডমিন /সুপার এজেন্টদের সাথে যোগাযোগ করুন।\r\nএজেনেট সম্পর্কে কোন অভিযোগ থাকলে সরাসরি কাস্টমার সার্ভিসে যোগাযোগ করতে পারেন অবথা সুপার এজেন্ট/এডমিনকে জানাতে পারেন।\r\n\r\n ➡️এখানে কি কি বাজি ধরা যায়?\r\n\r\nআপনি অনেক ধরনের বাজিই ধরতে পারেন।এখানে ক্লিক করে ওয়েবসাইট ঘুরে দেখে আসতে পারেন\r\n\r\n➡️ যেকোনো ক্রিকেট ম্যাচে বাজি ধরতে পারেন। প্রতি ম্যাচে, ওভারে বা বলে বলেও বাজি ধরতে পারেন।\r\n\r\n➡️ IPL, BPL, PSL, T10 সহ সকল লিগ ম্যাচেও একইভাবে বাজি ধরতে পারেন।\r\n\r\n➡️ সকল ফুটবল ম্যাচে বাজি গালাতে পারেন।\r\n\r\n➡️ ক্যাসিনো খেলতে পারেন।\r\n\r\n➡️ তিনপাত্তি সহ তাসের বাজি গুলোতে বেটিং করতে পারেন।\r\n\r\nএছাড়াও আরো অনেক মজার মজার বাজি রয়েছে, যেগুলোতে আপনি অনায়াসে বাজি ধরতে পারেন। আরো বিস্তারিত জানতে agentlist24-এর ওয়েবসাইটে ঘুরে আসুন নিচে ক্লিক করে।', '2023-10-22 14:21:27', '2023-10-22 14:21:27'),
(61, 36, 8, 'আপনি এখানে ক্লিক করে agentlist24 এর ওয়েবসাইটে সরাসরি চলে যেতে পারেন। তারপর সেখানে নিরাপদে বেটিং করতে পারেন। বেটিং করার আগে আপনার একাউন্ট খুলে নিন। একাউন্ট খুলতে নিচে ক্লিক করুন।\r\nhttps://24bet.vip/', '2023-10-22 14:23:57', '2023-10-22 14:23:57'),
