(109, 27, 8, 'এজেন্টের কাছ থেকে আপনাকে কয়েন কিনতে হবে। কিন্তু কয়েন কিনার আগে অবশ্যই আপনার পছন্দের এজেন্টের কাছ থেকে একাউন্ট করিয়ে নিবেন। কয়েন বেচা এবং কেনার কাজ এজেন্টই করে দিবে। এজেন্ট আপনাকে একাউন্ট খোলার নিয়ম বলে দিবে।এজেন্ট আপনাকে একাউন্ট খুলে দিবে। আমাদের সাইটে সর্বনিম্ন ডিপোজিট এবং উইথড্র ৫০০ টাকা – মানে ৫০০ পয়েন্ট।', '2023-12-07 14:37:02', '2023-12-07 14:37:02'),
(110, 30, 8, '➡️জ্বী আপনি কয়েন জিতলেই উইড্র করে এজেন্টদের কাছ থেকে টাকা নিয়ে নিতে পারেন। তবে আপনার সর্বনিম্ন উইড্র হচ্ছে ৫০০ কয়েন বা ৫০০ টাকা।বিস্তারিত জানতে এজেন্টের সাথে কথা বলুন।নিচে এজেন্ট লিস্ট দেয়া আছে। এজেন্ট লিস্টে গিয়ে তাদের নামের উপর ক্লিক করলেই সরাসরি তাদের সাথে ফেইসবুকে কথা বলতে পারবেন অথবা নাম্বারের উপর ক্লিক করলেই সরাসরি হোয়াটসঅ্যাপে যোগাযোগ করতে পারেন।', '2023-12-07 14:38:02', '2023-12-07 14:38:02'),
(112, 17, 8, 'জ্বী অবশ্যই হতে পারবেন। সেজন্য আপনাকে Agent List 24 এর সুপার এজেন্টদের সাথে যোগাযোগ করতে হবে।\r\n\r\nএজেন্ট হওয়ার শর্তঃ-\r\n\r\n\r\n➡️ কমপক্ষে ৫০,০০০ কয়েন কিনে এজেন্টশিপ চালাতে হবে।\r\n\r\n⛔ উক্ত শর্তটি পুরন করতে না পারলে কখনোই সুপার এজেন্টদের নক দিবেন না।\r\nএজেন্ট পয়েন্ট রেটঃ-\r\n\r\nএজেন্টরা সুপার এজেন্টদের কাছ থেকে ৭০ টাকা করে কয়েন কিনবে পারবে এবং ১০০ টাকা করে ইজারদের কাছে বিক্রি করবে।\r\nএজেন্ট এর লাভ/লস:-\r\n\r\nএজেন্টরা কয়েন প্রতি ৩০% লাভ পাবে। লাভ এবং লস বিস্তারিত জানতে সুপার এজেন্টদের নক করুন  ।', '2023-12-07 14:41:42', '2023-12-07 14:41:42');
